CREATE TEMPORARY FUNCTION get_keyval_pairs(y STRING)
RETURNS ARRAY<STRING>
LANGUAGE js
AS
  '''
  var z = new Array();
  node = JSON.parse(y);
  for (let [key, value] of Object.entries(node)) {
    z.push(`${key}:${value}`);
  }
  return z;
''';

